import utils from "../styles/utils.module.css";

const Contact = () => {
  return (
    <section>
      <div className={utils.container}>
        <div className="wrapper">
          <article>
            <h2>Send me a message!</h2>
            <p>
              I'm currently open to opportunities, I would love to learn more
              about what you're building.
            </p>
          </article>
          <form>
            <div>
              <div>
                <label>Your Name</label>
                <input />
              </div>
              <div>
                <label>Email Address</label>
                <input />
              </div>
            </div>
            <div>
              <textarea></textarea>
            </div>
            <button>
              <div>SEND</div>
              <svg
                width="77"
                height="22"
                xmlns="http://www.w3.org/2000/svg"
                fill="none"
                viewBox="0 0 24 24"
                stroke="currentColor">
                <path
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  strokeWidth={2}
                  d="M17 8l4 4m0 0l-4 4m4-4H3"
                />
              </svg>
            </button>
          </form>
        </div>
      </div>

      <style jsx>
        {`
          section {
            position: relative;
            background: #f0fff4;
            color: #22543d;
            min-height: 100vh;
            text-align: center;
          }

          section > div {
            margin-top: 20px;
          }
          
        `}
      </style>
    </section>
  );
};

export default Contact;
